import React, { useState, useEffect } from 'react';
// eslint-disable-next-line no-unused-vars
import api from '../api'; // Kept with suppression

export default function Dashboard({ products: initialProducts = [], onStockChange }) {
  const [products, setProducts] = useState(initialProducts);
  const [editStock, setEditStock] = useState({}); // { productId: editingValue }

  useEffect(() => {
    setProducts(initialProducts);
  }, [initialProducts]);

  const totalItems = products.length;
  const totalStock = products.reduce((s, p) => s + Number(p.quantity || 0), 0);
  const lowStock = products.filter(p => Number(p.quantity || 0) <= 5).length;

  const handleImageError = (e) => {
    e.target.src = 'https://via.placeholder.com/150?text=Image+Not+Available';
  };

  const handleStockChange = (id, value) => {
    if (/^\d*$/.test(value)) {
      setEditStock(prev => ({ ...prev, [id]: value }));
    }
  };

  return (
    <div className="dashboard card" style={{ padding: '1rem' }}>
      <h3>Dashboard Overview</h3>
      <div className="summary-cards" style={{ display: 'flex', gap: '1rem', marginBottom: '1rem' }}>
        <div className="summary-card" style={{ flex: 1, padding: '1rem', border: '1px solid #ddd', borderRadius: 4 }}>
          <h4>Total Items</h4>
          <p><strong>{totalItems}</strong></p>
        </div>
        <div className="summary-card" style={{ flex: 1, padding: '1rem', border: '1px solid #ddd', borderRadius: 4 }}>
          <h4>Total Stock</h4>
          <p><strong>{totalStock}</strong></p>
        </div>
        <div className="summary-card" style={{ flex: 1, padding: '1rem', border: '1px solid #ddd', borderRadius: 4 }}>
          <h4>Low Stock</h4>
          <p><strong>{lowStock}</strong></p>
        </div>
      </div>

      <div
        className="product-cards"
        style={{
          display: 'flex',
          flexWrap: 'wrap',
          gap: '1rem',
          marginTop: '1rem',
          justifyContent: 'flex-start',
        }}
      >
        {products.slice(0, 5).map(p => (
          <div
            key={p.id}
            className="product-card"
            style={{
              border: '1px solid #ddd',
              padding: 10,
              width: 200,
              borderRadius: 6,
              boxShadow: '0 2px 4px rgb(0 0 0 / 0.1)',
              display: 'flex',
              flexDirection: 'column',
              alignItems: 'center',
            }}
          >
            <img
              src={p.image || 'https://via.placeholder.com/150?text=No+Image'}
              alt={p.name}
              className="product-image"
              style={{
                width: '100%',      // Fit inside the card width
                height: 250,
                objectFit: 'cover',
                marginBottom: '8px', // Space between image and text below
                borderRadius: 4,
              }}
              onError={handleImageError}
            />
            <div className="product-info" style={{ textAlign: 'center' }}>
              <h4 style={{ margin: '0 0 8px 0' }}>{p.name}</h4>
              <p style={{ margin: '0 0 8px 0' }}>Price: M{Number(p.price || 0).toFixed(2)}</p>
              <div>
                <label>
                  Quantity:&nbsp;
                  <input
                    type="text"
                    value={editStock[p.id] !== undefined ? editStock[p.id] : p.quantity}
                    onChange={(e) => handleStockChange(p.id, e.target.value)}
                    style={{ width: '60px', textAlign: 'center' }}
                    readOnly
                  />
                </label>
              </div>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
}
